import math
import openpyxl

workbook = openpyxl.load_workbook("/content/TS_variants_Lab_2.xlsx")

sheet = workbook["TS_variants_Lab_4"]  # Получение листа по имени

# Класс буду использовать в качестве структуры. т.е. пока обойусь без инкапсуляции, геттеров, сеттеров и т.д.


class Car():
    """
    Хранит данные о машинах
    """

    # Конструктор
    def __init__(self, name, carPrice, maintenancePrice, gasolinePer100, comfort):
        """
        Параметры
        name:
            Название машины
        """
        self.Name = name
        self.CarPrice = carPrice
        self.MaintenancePrice = maintenancePrice
        self.GasolinePer100 = gasolinePer100
        self.Comfort = comfort


    def GetInfo(self):
        """
        Выводит информацию о машине.
        """
        print("Название: " + str(self.Name), "Цена: " + str(self.CarPrice), "Расходы на обслуживание: " + str(self.MaintenancePrice),
               "Бензин на 100 км: " + str(self.GasolinePer100), "Комфорт: " + str(self.Comfort))

        # можно и так
        #return self.Name, self.Car_price, self.Maintainence_price, self.Gasoline_Per_100, self.Comfort

# список для хранения автомобилей
cars = []

# Получаю данные из моего варианта
for row in sheet.iter_rows(min_row=11, max_row=15, values_only=True):

    new_car = Car(row[0],row[1],row[2],row[3],row[4])
    cars.append(new_car)

    print(row)

for i in cars:
    i.GetInfo()

"""## Нормирование параметров

Чем выше значение, тем лучше.

![image.png](data:image/png;base64,)

qjab - текущий элемент, qjet - максимальный элемент


Чем ниже значение,тем лучше.

![image.png](data:image/png;base64,)


где qjmin, qjmax – соответственно минимальное и максимальное значения j-го критерия.
Важно: qjmin должно быть меньше минимального значения в наборе данных, а qjmax
должен быть больше.
"""

# Задание минимальных и максимальных значений
MinPrice = 500
MaxPrice = 1000
MinMaintenancePrice = 10
MaxMaintenancePrice = 40
MinGasolinePer100 = 5
MaxGasolinePer100 = 15

# Определение весовых коэффициентов критериев
PriceCoefficient = 0.5
MaintenanceCoefficient = 0.25
GasolinePer100Coefficient = 0.25

# Все параметры: цену, расходы на обслуживание, расход бензина, нормируем по формуле 2, так как, чем ниже эти параметры, тем лучше.
for i in cars:
    i.CarPriceNorm = (MaxPrice - i.CarPrice)/(MaxPrice - MinPrice)
    i.MaintenancePriceNorm = (MaxMaintenancePrice - i.MaintenancePrice)/(MaxMaintenancePrice - MinMaintenancePrice)
    i.GasolinePer100Norm = (MaxGasolinePer100 - i.GasolinePer100)/(MaxGasolinePer100 - MinGasolinePer100)

for i in cars:
    print(i.CarPriceNorm, i.MaintenancePriceNorm, i.GasolinePer100Norm)

"""## Аддитивная свёртка

Значение интегрального критерия определяется как сумма значений частных критериев, поделенная на количество частных критериев:

![image.png](data:image/png;base64,)

В случае если частные критерии имеют различную важность (вес), вместо формулы среднеарифметического для определения значения интегрального критерия используют средневзвешенное арифметическое:

![image.png](data:image/png;base64,)



где vj – вес j-го критерия, отражающий вклад частного критерия в интегральный.

### Одинаковые весовые коэффициенты
"""

# число критериев
number = 3

sum = 0
for i in cars:
    sum += i.CarPriceNorm
    sum += i.MaintenancePriceNorm
    sum += i.GasolinePer100Norm

    # Аддитивная свёртка, без коэффициентов
    i.AdConvWoCoef = sum/3

    sum = 0

"""Из полученных данных видно, что, согласно аддитивной свёртке, наилучим вариантом является машина А1."""

for i in cars:
    print(i.Name, i.AdConvWoCoef)

"""### Разные весовые коэффициенты"""

sum = 0
for i in cars:
    sum += PriceCoefficient*i.CarPriceNorm
    sum += MaintenanceCoefficient*i.MaintenancePriceNorm
    sum += GasolinePer100Coefficient*i.GasolinePer100Norm

    # Аддитивная свёртка с разными коэффициентами
    i.AdConvWCoef = sum

    sum = 0

"""Если учесть разый вес коэффициентов, то препочтительным вариантом всё ещё будет А1"""

for i in cars:
    print(i.Name, i.AdConvWCoef)

"""## Мультипликативная свёртка

Если частные критерии имеют одинаковый вес, значение интегрального критерия определяется по формуле среднегеометрического

![image.png](data:image/png;base64,)

Если	же	частные	критерии	имеют	различную	важность,	то	определяется средневзвешенное геометрическое

![image.png](data:image/png;base64,)

### Одинаковые весовые коэффициенты
"""

sum = 0

for i in cars:
    sum = i.CarPriceNorm
    sum *= i.MaintenancePriceNorm
    sum *= i.GasolinePer100Norm

    #
    i.MultConvWoCoef = pow(sum, 1/3)

    sum = 0

"""Cогласно мультипликативной свёртке, наилучим вариантом является машина А1."""

for i in cars:
    print(i.Name, i.MultConvWoCoef)

"""### Разные весовые коэффициенты"""

sum = 0

for i in cars:

    sum = i.CarPriceNorm**PriceCoefficient
    sum *= i.MaintenancePriceNorm**MaintenanceCoefficient
    sum *= i.GasolinePer100Norm**GasolinePer100Coefficient

    i.MultConvWCoef = sum

    sum = 0

"""Мультипликативная свёртка с учётом коэффициентов также показывает, что А1 - наиболее предпочтительный"""

for i in cars:
    print(i.Name, i.MultConvWCoef)



"""## Метод идеальной точки

Метод идеальной точки. Прежде всего, необходимо задать идеальную точку x0, т. Е. объект с наилучшими значениями по всем критериям. Для этого по каждому из частных критериев qj необходимо определить наилучшее значение qj(x0). Как правило, qj(x0) = max qj(xj). В случае, если значения нормированы в диапазоне [0…1], идеальной точкой будет элемент с оценками 1 по всем критериям.
Значение интегрального критерия для объекта xi определяется через евклидовое расстояние между ним и идеальной точкой x0 по всем частным критериям:

![image.png](data:image/png;base64,)


В случае различной важности частных критериев используется взвешенная сумма расстояний

![image.png](data:image/png;base64,)

### Одинаковые весовые коэффициенты
"""

sum = 0

for i in cars:

    sum += (1 - i.CarPriceNorm)**2
    sum += (1 - i.MaintenancePriceNorm)**2
    sum += (1 - i.GasolinePer100Norm)**2

    i.IdPointWoCoef = math.sqrt(sum/3)

    sum = 0

"""Наименьшее расстояние от идеальной точки имеет машина А1"""

for i in cars:
    print(i.Name, i.IdPointWoCoef)

"""### Разные весовые коэффициенты"""

sum = 0

for i in cars:

    sum += PriceCoefficient*(1 - i.CarPriceNorm)**2
    sum += MaintenanceCoefficient*(1 - i.MaintenancePriceNorm)**2
    sum += GasolinePer100Coefficient*(1 - i.GasolinePer100Norm)**2

    i.IdPointWCoef = math.sqrt(sum)

    sum = 0

"""Если учесть разные весовые коэффициенты, минимальное расстояние также будет у А1"""

for i in cars:
    print(i.Name, i.IdPointWCoef)